import getEmail from "../../redux/reducers/getEmail"

const GetEmail =()=>{

    const getJSON = ()=>{
        const response = fetch("http://192.168.1.247:3001/api/user/home")
        return response.json()
    }   

    return(
        <h1>{getEmail}</h1>
    )
}

export default GetEmail
